import React from "react";
import { Container, Col, Row } from "reactstrap";
import Signup from "../home/Signup";
import Login from "../home/Login";

const Auth = (props) => {
  return (
    <Container className="text-center">
      <Row>
        <Col md={{ span: 6, offset: 5 }} >
          <Signup />
        </Col>
      </Row>

      <Row>
        <Col md >
          <Login />
        </Col>
      </Row>
    </Container>
  );
};

export default Auth;
